        height: 100%;
        overflow: hidden;
    }

    body {
        font-family: 'Roboto', sans-serif;
        background: linear-gradient(to right, #1e1e1e, #000000);
        color: #ffffff;

        align-items: center;
        justify-content: center;
        height: 100%;

        color: #ffffff;

        width: 400px;
        margin-top: 20px; /* Adjust the margin as needed */
    }

    .login-form {
        display: flex;
        flex-direction: column;
        align-items: center;
    }

    label {
        margin-top: 10px;
        color: #bdc3c7;
    }

    button {
        padding: 14px;
        background: linear-gradient(to right, #3498db, #2980b9);
        color: #fff;
        border: none;
        border-radius: 10px;
        cursor: pointer;
        width: 100%;
        font-weight: bold;
        font-size: 18px;
        margin-top: 4%;
